import React from 'react';
import {
    Container,
    TitleLabel,
    InfoLabel,
    LineContainer
} from './style';


interface IAddress {
    city: string;
    neiborhood?: string;
    street?: string;
    uf?: string;
    ddd?: string;
}

export const Address: React.FC<IAddress> = ({ 
    city,
    neiborhood,
    street,
    uf,
    ddd
}) => {
    return (
        <Container>
            <LineContainer>
                <TitleLabel>Cidade:</TitleLabel>
                <InfoLabel>{city}</InfoLabel>

                <TitleLabel>Estado:</TitleLabel>
                <InfoLabel>{uf}</InfoLabel>

                <TitleLabel>Cidade:</TitleLabel>
                <InfoLabel>{city}</InfoLabel>

                <TitleLabel>Cidade:</TitleLabel>
                <InfoLabel>{city}</InfoLabel>

                <TitleLabel>Cidade:</TitleLabel>
                <InfoLabel>{city}</InfoLabel>

            </LineContainer>
        </Container>
    )
}
